import React, { Component, useEffect } from 'react';
import BasePageHugeCard from '../BasePages/BasePageHugeCard.js';
import EditThemesListSecretaryForm from '../../components/Tables/EditThemeList/Secretary/EditThemesListSecretaryForm.js';

const EditThemeListSecretary = ({ secretaryData, themes_list, teachers_list}) => {
    useEffect(() => {
        document.title = "Редактирование списка тем ВКР";
      }, []);
    
    return (
        <BasePageHugeCard isAuthenticated={true} data={secretaryData}>
       <EditThemesListSecretaryForm themesList={themes_list} data={secretaryData} teachers_list={teachers_list}/>
          </BasePageHugeCard>
      );
    

}
export default EditThemeListSecretary;
